import React from 'react';
import './Timetable.css';

const Timetable = ({ onRouteChange }) => {
	return(
		<div className='tt'>
			<div className='time'>
				<p className='f3 p1'>Days</p>
				<p className='f3 p2'>9-10 am</p>
				<p className='f3 p3'>10-11 am</p>
				<p className='f3 p4'>11-12 am</p>
				<p className='f3 p5'>12-1 pm</p>
				<p className='f3 p6'>1-2 pm</p>
				<p className='f3 p7'>2-3 pm</p>
				<p className='f3 p8'>3-4 pm</p>
				<p className='f3 p9'>4-5 pm</p>
				<p className='f3 p10'>5-6 pm</p>
			</div>
		</div>
	);
}

export default Timetable;
